* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
    font-family: 'Poppins', sans-serif;
}
a {
    list-style: none;
    text-decoration: none;
    &:hover {
        list-style: none;
        text-decoration: none;
    }
}
.container {
    width: 100%;
    height: 5vh;
    display: flex;
    align-items: center;
    justify-content: space-around;
    background-color: rgb(17, 17, 17);
    .contact-info {
        display: flex;
        width: 40%;
        justify-content: space-between;
        height: 5vh;
        color: rgb(224, 218, 218);
        .phone {
            display: flex;
            width: 50%;
            justify-content: center;
            align-items: center;
            span {
                color: rgb(224, 218, 218);
                margin-left: 10px;
                font-size: 18px;
            }
        }
        .email {
            display: flex;
            width: 50%;
            justify-content: center;
            align-items: center;
            span {
                color: rgb(224, 218, 218);
                margin-left: 10px;
                font-size: 18px;
            }
        }
        .fa-phone {
            display: flex;
            color: orange;
            margin-right: 10px;
            font-size: 20px;
        }
        .fa-envelope {
            color: orange;
            margin-right: 10px;
            font-size: 20px;
        }
    }
    .social-info {
        display: flex;
        width: 35%;
        justify-content: space-around;
        height: auto;
        color:  rgb(224, 218, 218);
        .language {
            display: flex;
                a {
                    display: flex;
                    justify-content: center;
                    align-items: center;
                }
        }
        .social {
            display: flex;
            width: 50%;
            justify-content: center;
            align-items: center;
            a {
                display: flex;
                justify-content: center;
                align-items: center;
            }
        }
        .fa-globe {
            color: orange;
            margin-left: 5px;
            font-size: 20px;
        }
        .fa-instagram {
            color: orange;
            margin-left: 5px;
            font-size: 20px;
        }
        .fa-facebook {
            color: orange;
            margin-left: 5px;
            font-size: 20px;
        }
    }
    }
